import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import reportWebVitals from './reportWebVitals';
import Listeencheres from './components/Listeencheres';
import Historique from './components/Historique';
import App from './App';



const index = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={Listeencheres} exact></Route>
        <Route path="/historique" element={Historique} exact></Route>
        <Route path="/listeenchere" element={Listeencheres} exact></Route>
      </Routes>
    </BrowserRouter>
  );
};

export default index;

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
